export const initialState: State = {
  typeName: "Title",
  ytdvalue: NA,
  ytd_css_property: DEFAULT_CSS_PROPERTY,
  yffvalue: NA,
  yff_css_property: DEFAULT_CSS_PROPERTY,
  gpyvalue: NA,
  gpy_css_property: DEFAULT_CSS_PROPERTY,
};

export class ReactCircleCard extends React.Component<{}, State> {
  private static updateCallback: (data: object) => void = null;

  public static update(newState: State) {
    if (typeof ReactCircleCard.updateCallback === "function") {
      ReactCircleCard.updateCallback(newState);
    }
  }

  public state: State = initialState;

  public componentWillMount() {
    ReactCircleCard.updateCallback = (newState: State): void => {
      this.setState(newState);
    };
  }

  public componentWillUnmount() {
    ReactCircleCard.updateCallback = null;
  }

  private GetIconOrMapPath(type, typename) {
    var data =
      type === "icon" ? CountryMap.Icon : CountryMap.backgroundMapImage;
    for (var i = 0, len = data.length; i < len; i++) {
      var newTypeName = typename.replace(/\s*/g, "");
      console.log("data[i]: ", data[i]);
      if (
        data[i].name === newTypeName.toUpperCase() ||
        data[i].code === newTypeName.toUpperCase() ||
        newTypeName.toUpperCase().indexOf(data[i].name) !== -1 ||
        newTypeName.toUpperCase().indexOf(data[i].code) !== -1
      ) {
        return data[i].path;
      }
    }
    return "";
  }
  constructor(props: any) {
    super(props);
    this.state = initialState;
  }

  render() {
    const {
      typeName,
      ytdvalue,
      yffvalue,
      gpyvalue,
      ytd_css_property,
      yff_css_property,
      gpy_css_property,
    } = this.state;
    const ytdbgc: React.CSSProperties = { ...ytd_css_property };
    const fyybgc: React.CSSProperties = { ...yff_css_property };
    const gpybgc: React.CSSProperties = { ...gpy_css_property };

    var backgroundImage =
      typeName.toUpperCase() === "GROUP"
        ? {}
        : {
            backgroundImage:
              "url(" + this.GetIconOrMapPath("map", typeName) + ")",
            backgroundSize: "contain",
            backgroundPosition: "50% 20%",
            backgroundOrigin: "content",
            backgroundRepeat: "no-repeat",
          };
    console.log(typeName);
    return (
      <div className="container" style={backgroundImage}>
        <div className="title-top label">
          {typeName.toUpperCase() === "GROUP" || typeName === "Title" ? (
            ""
          ) : (
            <img
              className="title-icon"
              src={this.GetIconOrMapPath("icon", typeName)}
            ></img>
          )}
          <span>{typeName}</span>
        </div>
        <div className="label">Performance over Plan</div>
        <div className="label">
          <div style={{ float: "left", width: "50%" }}>
            <div
              style={{
                float: "right",
                width: "80px",
                textAlign: "center",
                margin: "0 10px",
              }}
            >
              <p className="value-view" style={ytdbgc}>
                {ytdvalue}
              </p>
              <p className="value-label">YTD</p>
            </div>
          </div>
          <div style={{ float: "right", width: "50%" }}>
            <div
              style={{
                float: "left",
                width: "80px",
                textAlign: "center",
                margin: "0 10px",
              }}
            >
              <p className="value-view" style={fyybgc}>
                {yffvalue}
              </p>
              <p className="value-label">FY Fore</p>
            </div>
          </div>
        </div>
        <div className="label">Growth over Past year</div>
        <div className="label">
          <span className="value-view" style={gpybgc}>
            {gpyvalue}
          </span>
        </div>
      </div>
    );
  }
}

